const patrolPlatform = (wolf, platform) => {
  if (wolf.body.velocity.x > 0 && wolf.x + wolf.width > platform.x + platform.width) {
      wolf.body.velocity.x *= -1;
  }
  else if (wolf.body.velocity.x < 0 && wolf.x - wolf.width < platform.x - platform.width) {
      wolf.body.velocity.x *= -1;
  }
}

